def menu():
 x = input("\nWybierz żądaną funkcję programu:\na - Sprawdzanie, czy wyraz znajduje się w słowniku\nb - Wyszukiwanie w bazie słówek rozpoczynających się na (cośtam)\nc - Zakończ działanie programu\n   :")
 if x == "a" or x == "A":
  spr()
  menu()
 if x == "b"or x == "B":
  poczatek()
  menu()
 if x == "c" or x == "C":
  raise NameError("<Papa!!!") 
